def ChangeToInt(word):
    if word.isnumeric():
        return int(word)
    else:
        word_split_filer = re.search(r'(\S+)(K|M|G|T|P|E)',word,re.I)
        if word_split_filer:
            if word_split_filer.group(1) and word_split_filer.group(2):
                number = float(word_split_filer.group(1))
                unit = word_split_filer.group(2)
                if 'K' in unit or 'k' in unit:
                    word = int(number * 1000)
                elif 'M' in unit or 'm' in unit:
                    word = int(number * (1000**2))
                elif 'G' in unit or 'g' in unit:
                    word = int(number * (1000**3))
                elif 'T' in unit or 't' in unit:
                    word = int(number * (1000**4))
                elif 'P' in unit or 'p' in unit:
                    word = int(number * (1000**5))
                elif 'E' in unit or 'e' in unit:
                    word = int(number * (1000**6))
        return word
    
def ParseText(config):
    cpu_lst = re.findall(r'load averages:\s+\S+,\s+\S+,\s+(\S+)',config,re.M)
    if cpu_lst:
        cpu_usage  = sum([float(x) for x in cpu_lst if x])/len(cpu_lst)
    else:
        cpu_usage = float(0)
    mem_total = 0
    mem_free = 0

    mem_lst = re.findall(r'Mem: (\S+) Active, (\S+) Inact, (\S+) Wired, (\S+) Cache, (\S+) Buf, (\S+) Free',config,re.M)
    for each in mem_lst:
        node_mem = sum([ChangeToInt(x) for x in each if x])
        node_mem_free = ChangeToInt(each[-1])
        mem_total += node_mem
        mem_free += node_mem_free

    if mem_total and mem_free:
        mem_usage = round(((mem_total - mem_free) * 100 / mem_total), 2)
    else:
        mem_usage = None
    dic = { 'memory_usage': int(mem_usage),
            'cpu_usage': int(cpu_usage),
            }

    return dic
